package com.daengdaeng.domain.pet.domain;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import lombok.AccessLevel;import lombok.Getter;import lombok.NoArgsConstructor;@NoArgsConstructor(access = AccessLevel.PROTECTED)@Getter@Entitypublic class MbtiType {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	private int typeId;	@Column(nullable = false, unique = true)	private char type;}